import React from 'react';

const ProductData = (item) => (
    <div>
        {item.map((Data) =>
        <>
        <h3>{Data.name}</h3>
        <img src={Data.photo} alt={Data.alt} />
        <p>{Data.price}</p>
        <p>{Data.description}</p>
        <button>Add To Cart</button>
        </>
        )}  
    </div>
);

export default ProductData;
